import './MenuBtn.scss'
import '../Btn/Btn.scss'
import react from 'react-dom'


const MenuBtn = () => {

    const btnVisibility = document.getElementsByClassName("reg");

    if (window.innerWidth > 800) {
        btnVisibility.style.Display = "none";
        // alert("hekkp");
    } 

    const btnText = "Register";
    return (
        <div className="reg">

        <button className="login-btn-2">{btnText}</button>

       </div>

    )
}

export default MenuBtn
